import React from 'react'
//css
import './Searchbar.css'
//components
import Field from '../Field/Field'

export default function Searchbar(props) {

    const type = ['normal', 'poison', 'psychic', 'grass', 'ground', 'ice', 'fire', 'rock', 'dragon', 'water', 'bug', 'dark', 'fighting', 'ghost', 'steel', 'flying', 'electric', 'fairy'];
    const habitat = ['grassland', 'forest', 'waters edge', 'sea', 'cave', 'mountain', 'rough-terrain', 'urban', 'rare'];
    const color = ['red', 'blue', 'yellow', 'green', 'black', 'brown', 'purple', 'gray', 'white', 'pink'];


    return (
        <div className="Searchbar">
            <Field togglechangeToggle={props.changeToggle} stats={habitat}/>
            <Field changeToggle={props.changeToggle} stats={type}/>
            <Field changeToggle={props.changeToggle} stats={color}/>
        </div>
    )
}
